INSERT INTO `spotinfo` VALUES ('1', '中央大街', '道里区', '哈尔滨中央大街步行街是目前亚洲最大最长的步行街，始建于1898年，初称\"中国大街\"。1925年改称为沿袭至今的\"中央大街\"，现在发展成为哈尔滨市最繁华的商业街。大街北起松花江防洪纪念塔，南至经纬街，全长1450米，宽21.34米，其中车行方石路10.8米宽。被誉称\"哈尔滨第一街\"的中央大街，以其独特的欧式建筑，鳞次栉比的精品商厦，花团锦簇的休闲小区以及异彩纷呈的文化生活，成为哈尔滨市一道亮丽的风景线。', , '1');
INSERT INTO `spotinfo` VALUES ('8', '万达茂', '松北区', '哈尔滨万达茂依托独具文化底蕴的巨型钢结构建筑“红钢琴”，配以充满生活情调和人文色彩浓厚的业态，以冰雪文化为独家特色，以哈尔滨城市文化彰显本土风情。悦享冰雪特色，体味城市风情，趣玩新潮科技，独享“高配”品牌，市民与游人在哈尔滨万达茂所感受到的不仅仅是绝佳的消费体验，还有更丰富的多文化体验。', , '0');
INSERT INTO `spotinfo` VALUES ('9', '防洪纪念塔', '道里区', '哈尔滨防洪胜利纪念塔，坐落在风景如画的松花江南岸，是 这座英雄城市的象征，是为纪念哈尔滨市人民战胜“57年特大洪水”于1958年10月1日建成的。它由前苏联设计师巴吉斯·兹耶列夫和哈工大第二代建筑师李光耀共同设计，塔址由时任哈尔滨市市长吕其恩确定。哈尔滨防洪胜利纪念塔由基座塔身、喷泉、围廊和广场等四部分组成。塔的基座呈方形，上窄下宽，带有收分，由深绿色花岗碎石砌成，非常坚固耐久。', , '1');
INSERT INTO `spotinfo` VALUES ('13', '冰雪大世界', '松北区', '中国哈尔滨冰雪大世界始创于1999年，是由哈尔滨市政府为迎接千年庆典神州世纪游活动，凭借哈尔滨的冰雪时节优势，而推出的大型冰雪艺术精品工程，展示了北方名城哈尔滨冰雪文化和冰雪旅游魅力。在冰雪大世界，您可以观赏到世界上最高、最美、最雄伟、最具魅力的冰雪奇观。', , '1');
INSERT INTO `spotinfo` VALUES ('14', '索菲亚教堂', '道里区', '索菲亚教堂坐落在东北名城哈尔滨，始建于1907年3月，位于中国黑龙江省哈尔滨市道里区中央大街东侧的透笼街，是一座典型的拜占庭式东正教教堂，主穹顶、钟楼又有俄罗斯传统的“帐篷顶”、“洋葱头”造型。原为沙俄东西伯利亚第四步兵师修建中东铁路的随军教堂，全木结构，占地面积为721平方米，通高53.35米，平面呈拉丁十字布局。文革期间教堂遭到部分破坏，曾经长期作为哈尔滨第一百货公司的仓库使用，并且教堂四周被建筑物所遮挡。', , '1');
INSERT INTO `spotinfo` VALUES ('15', '太阳岛', '松北区', '太阳岛自然风景异常秀美。全岛碧水环抱、水光潋滟、树木葱茏，幽雅静谧、野趣浓郁，原野风光质朴粗犷。\r\n									夏季，风景秀丽，气候宜人，游览区西侧，百花竞放，绿茵覆地；太阳湖中，荷花艳丽，灿若云霞；\r\n									遍岛绿野繁花，四周白沙细浪，岛上红松、樟子松、落叶松、云杉、杨、柳、榆、椴及丁香、玫瑰，\r\n									30万株乔木灌木，万木争荣、浓荫匝地。冬季，雪漫冰封，银装素裹，北国风光，分外妖娆。', , '1');
INSERT INTO `spotinfo` VALUES ('16', '龙塔', '南岗区', '龙塔，即黑龙江省广播电视塔，是东北第二大城市哈尔滨的标志性建筑。塔高336米，\r\n									高度在钢塔中位于世界第十四，亚洲第九。是一座集广播电视发射、旅游观光、餐饮娱乐、广告传播、\r\n									环境气象监测、微波通讯、无线通讯于一体的综合性多功能塔。', , '1');
INSERT INTO `spotinfo` VALUES ('17', '莫斯科大剧院', '松北区', '莫斯科演艺娱乐广场莫斯科大剧院隶属于鼎鑫餐饮娱乐集团，成立于2005年，\r\n									营业面积5000平方米，是千万投资、精心打造的黑龙江省内唯一顶级演艺娱乐场所，它荟萃黑龙江黑土地风俗、\r\n									俄罗斯异域风情、哈尔滨啤酒文化等龙江地域特色为一体的新的演出形式。剧场可容纳400人观看，欧式装修典雅堂皇、\r\n									顶级视听音响灯光，每日两场、截止目前累计共演出4000余场，接待外地旅游客人21万人次，深受中外来宾好评。', , '1');
INSERT INTO `spotinfo` VALUES ('18', '伏尔加庄园', '香坊区', '伏尔加庄园位于哈尔滨市香坊区成高子镇阿什河畔哈成路 16公里处，占地面积60多万平方米，是一个以俄罗斯文化为主题的园林，是完完全全充实着异域风情的庄园。', , '1');
INSERT INTO `spotinfo` VALUES ('19', '永泰世界主题乐园', '香坊区', '哈尔滨永泰世界--国内一流的室内主题乐园，位于哈尔滨香坊区永泰城中心4层-5层，是国内首家以梦幻天地为主题的室内主题乐园，投资达15亿元，建筑面积超过30000平方米，净高约20米的超大室内阳光穹顶设计，拥有银河奇境与云霄城堡王国两大主题原创区域，令宾客在四季如春的世界中感受无限的欢乐。', , '0');
INSERT INTO `spotinfo` VALUES ('20', '哈尔滨东北虎林园', '松北区', '东北虎林园位于松花江北岸，占地面积144万平方米，与太阳岛风景区毗邻。其中虎园占地36万平方米，是出于挽救和保护世界濒危物种东北虎而建立的园林。\r\n东北虎林园现建有成虎园、幼虎苑、科普展馆各一处。成虎园36万平方米，散放着30只野性猛虎，游人须乘专用旅游车漫游于群虎之间。', , '1');
